COPY public.diario_atividade (id, numero, nome, descricao) FROM stdin;
19	19	... Mas que tem soluções!	No seguimento da atividade anterior, os elementos do grupo dividem-se em grupos de 2 a 3 elementos. Neste contexto mais íntimo de discussão, o grupo é convidado a identificar estratégias de gestão de stresse e de coping que utilizam ou reconhecem que poderiam/deveriam utilizar, com o intuito de melhor gerir o stresse, as suas emoções e cuidar de si próprio (potenciando, sempre que possível, as experiências e o know-how dos próprios CI).\r\n O grupo deve sistematizar estas estratégias em cartolinas/ folhas (em texto, desenho ou outro). Por fim, cada grupo deverá apresentar aos colegas a sua "obra", promovendo a discussão e partilha entre todos.\r\nAs cartolinas/ folhas deverão ser afixadas no espaço onde decorre a sessão e lidas/ relembradas sempre que pertinente.
14	14	Pintar as emoções	Nesta atividade pretende-se que os CI relaxem através da pintura e reflitam sobre as suas emoções, inerentes às dificuldades na comunicação e na gestão de comportamentos desafiantes.\r\nO dinamizador deverá criar um ambiente calmo e com música a gosto do grupo. O grupo deverá estar disposto à volta de uma mesa, onde encontrarão o material necessário no centro desta.\r\nO CI é convidado a pintar as suas emoções, relativamente ao assunto explorado. Depois de todos terminarem, é pedido ao CI que partilhe com o grupo a sua "obra", fazendo referência às suas emoções. \r\nNo final, os CI são convidados a deixar a sua "obra" no espaço da parede reservado para o efeito.\r\nCaso haja algum CI que mostre constrangimentos em pintar, poderá, por exemplo, fazer recortes ou desenho, utilizando revistas e jornais.
1	1	O meu barco	A atividade inicia com uma viagem de barco.\r\nO barco de papel deverá passar pelas mãos de todos com movimentos dos braços simulando a navegação. \r\nEnquanto o barco passa pelos cuidadores, o dinamizador deverá acompanhar os movimentos com frases do tipo: \r\n\r\n* "todas as viagens têm altos e baixos, ... fases mais positivas e outras mais desafiantes", \r\n* "há sempre um ponto de partida, um contexto, que não pode ser esquecido, mas antes compreendido", \r\n* "e depois há um porto de abrigo, onde o barco vai atracar, trazendo para terra imensas coisas boas de outros lugares".\r\n\r\nDepois desta(s) primeira(s) volta(s), o dinamizador deverá pedir a cada elemento que partilhe com o grupo a sua identidade, para que todos se conheçam melhor. Então, de forma breve, e com o barco no seu "porto", cada um deverá dizer o seu nome e falar um pouco do contexto do cuidado prestado (por exemplo, de quem cuida, há quanto tempo cuida, o nível de cuidados prestados). \r\n\r\nDar liberdade para que a pessoa possa partilhar outras informações, caso o entenda (ex. idade, onde vive, doença do recetor de cuidados). \r\n\r\nNota: controlar eficazmente o tempo de participação dos elementos.
3	3	As comadres	Com esta atividade pretende-se promover uma relação empática entre os participantes, e relembrar a identidade dos elementos do grupo.\r\n\r\nÀ vez, cada elemento deverá apresentar o/a "compadre/ comadre" do lado, dizendo o seu nome e duas características individuais ou da sua história de vida.
12	12	Participação semanal - As dificuldades do dia-a-dia	Até à próxima sessão, são colocados 2 desafios ao CI:\r\n1. que tente implementar algumas das boas práticas exploradas nesta sessão;\r\n2. que traga uma situação vivenciada (pessoalmente ou não) que represente um contexto de difícil gestão, nomeadamente ao nível da comunicação ou comportamento inapropriado, para que se discuta na próxima sessão.\r\nO CI deverá registar no Diário de Bordo a sua experiência para discussão na próxima sessão.
8	8	Participação semanal - Agarro a oportunidade	Nesta sessão, a "participação semanal" desafia os CI a agarrarem a oportunidade de aplicar pelo menos uma das orientações/ boas práticas discutidas na sessão relativas à prestação de cuidados de higiene e conforto, eliminação, alimentação e medicação. O CI deverá registar no Diário de Bordo a sua experiência para discussão na próxima sessão.
9	9	Participação semanal - Em busca da boa postura	Com esta "participação semanal" pretende-se que o CI consolide os conhecimentos relativos às boas práticas nas transferências e posicionamentos do RC adquiridos na sessão. \r\n(Quando aplicável) O CI é convidado a experimentar outras opções de posicionamento e formas de apoiar a transferência, considerando as boas práticas visadas na sessão. \r\nÉ ainda solicitado ao CI que transmita este conhecimento e boas práticas aos seus familiares e amigos que o apoiam no cuidado.\r\nRegistar a concretização da atividade no Diário de Bordo, referindo também, caso tenha existido, alguma queixa de dor e os níveis de bem-estar sentidos ao longo dos dias.
5	5	Participação semanal - conhecer a doença	A "participação semanal" é uma tarefa a realizar entre as sessões e que reforça, deste modo, a continuidade da intervenção inter-sessões.\r\nNeste primeiro desafio é pedido aos CI, cujas doenças mentais dos RC tenham sido discutidas em sessão, que partilhem com familiares, vizinhos e/ou amigos os conhecimentos adquiridos na sessão, esclarecendo questões associadas à doença (sinais e sintomas, comportamentos esperados, evolução, ...). Registar a concretização da atividade no Diário de Bordo.
6	6	Emoticons	Participam mais ativamente nesta atividade os CI de RC com esquizofrenia ou incapacidade intelectual.\r\nNesta atividade pretende-se que o CI partilhe com o grupo os principais sentimentos/ estado de espírito quanto à gestão da doença do familiar/amigo, podendo refletir sobre as dificuldades, angústias e felicidades.\r\nCada elemento recebe três emoticons sem expressão facial (no fundo, três círculos amarelos). \r\nNeles, o CI deverá desenhar a expressão facial que representa o seu estado de espírito acerca da gestão da doença do familiar/amigo (utilizará o número de emoticons que entender).\r\n É então pedido a cada participante que partilhe com o grupo o(s) seu(s) emoticons, procurando-se uma perspetiva positiva e de valorização do papel do cuidador e da importância do apoio dado ao RC.
10	10	A comunicação é um desafio	Para esta atividade, estarão disponíveis 4 casos que representam situações de dificuldade na comunicação ou na gestão de comportamentos desadequados no âmbito de quadros de demência, perturbação bipolar, esquizofrenia ou incapacidade intelectual.\r\n \r\nO dinamizador lê um dos casos e convida o grupo a discuti-lo, de modo a identificar as boas práticas utilizadas, os potenciais erros ou debilidades, e apontar outras opções que permitam lidar com a situação. O dinamizador deverá validar/ corrigir as participações dos CI, acrescentando informação sempre que necessário.\r\n Para tal, terá a orientação do panfleto, a entregar no final ao CI, intitulado "Boas práticas na comunicação e na gestão de comportamentos".\r\n Deverá repetir-se para os restantes casos.\r\nApós a exploração de cada caso, os CI deverão sistematizar as boas práticas na comunicação e na gestão de comportamentos inapropriados em cartolinas/ folhas, num trabalho realizado em grupo (2 a 3 elementos cada). As cartolinas/ folhas deverão ficar afixadas no espaço existente para o efeito e lidas/ relembradas sempre que pertinente.
20	20	Participação semanal - Compreender o stresse e as emoções	Para esta semana, o desafio do CI é o de identificar, no seu dia-a-dia, as emoções inerentes ao cuidado prestado. Sempre que estas sejam negativas/"más", utilizar as estratégias referidas na sessão.\r\nRegistar a concretização da atividade no Diário de Bordo, preferencialmente, utilizando um registo pictórico do nível de stresse antes e depois do uso da estratégia.
15	15	Participação semanal - Ajudar a família a comunicar melhor	Neste desafio é pedido aos CI que partilhem com familiares, vizinhos e/ou amigos os conhecimentos adquiridos na sessão, nomeadamente as boas práticas na comunicação e na gestão dos comportamentos desafiantes. O CI deverá registar a concretização da atividade no Diário de Bordo.
17	17	Participação semanal - Um "bom" dia	Para esta semana, é colocado o desafio ao CI de ajudar o RC a alterar a organização e tipo de  atividades realizadas ao longo da semana. Isto é, pretende-se que o CI ajude o RC a ocupar o seu tempo com (mais) atividades de lazer, entretenimento e de estimulação que lhe sejam prazerosas. O CI deverá registar a concretização da atividade no Diário de Bordo.
16	16	Mapa de atividades do RC	Com o apoio da ficha "Como se ocupa", o CI deverá identificar as atividades que o RC mais gosta de realizar, como gosta(va) de ocupar o seu tempo. Quando todo o grupo tiver preenchido esta primeira parte, explica-se o exercício seguinte (verso da página). O CI deverá preencher o mapa semanal com as atividades que o RC realiza ao longo de uma semana normal/ típica. Em seguida, deve contabilizar as horas registadas no mapa das atividades prazerosas, refletindo sobre o "quanto" o RC realiza atividades que lhe dão prazer e satisfação ao longo da semana.
18	18	Sou um ser emocional...	O dinamizador deverá começar a atividade com a leitura de um testemunho de um cuidador, onde se relate o turbilhão de emoções associados ao cuidado, assim como a importância da gestão emocional.\r\nO grupo é convidado a refletir em silêncio sobre o testemunho que ouviram durante 1 ou 2 minutos. Posteriormente, o dinamizador deverá promover a discussão dos elementos acerca do caso: "O que acharam deste caso?", "Identificam-se com ele?", "Que tipo de emoções estão aqui presentes?", "Já as experienciaram?", "Como lidaram com elas?", "Que estratégias (de gestão de stresse e gestão emocional) utilizaram?"\r\nO dinamizador deverá abordar o conceito de stresse no contexto dos cuidados informais. Explorar os antecedentes, os comportamentos e pensamentos, assim como as consequências das mesmas (ciclo A - K - C). Deverá ainda referir a componente positiva do stresse na vida das pessoas.
25	25	Mapa de atividades do CI	Com o apoio da ficha "Como me ocupo", o CI deverá preencher o mapa semanal com as atividades que realiza ao longo de uma semana normal. \r\nEm seguida, deve contabilizar as horas registadas no mapa das atividades prazerosas, refletindo sobre o "quanto" investe na sua satisfação e bem-estar.
26	26	Participação semanal - Fazer mais e melhor	Neste último desafio, o CI deverá tentar melhorar a gestão do seu tempo, de modo a incluir a realização de atividades que lhe sejam satisfatórias e promovam o seu bem-estar. O CI deverá registar a concretização da atividade no Diário de Bordo.
27	27	A teia da amizade	Esta atividade procura criar o contexto para a partilha de emoções, sentimentos e ideias dos vários elementos do grupo quanto à participação no programa.\r\nOs elementos do grupo devem ser dispostos em círculo, sendo que o dinamizador tem consigo os 4 novelos de lã. Antes de passar o primeiro novelo a outro elemento, mantendo consigo uma ponta deste, deverá responder ao "Gostei de estar aqui convosco porque...". O novelo vai passando de elemento para elemento, em que cada um segura uma ponta do novelo, até que todos tenham respondido a esta questão. Segue-se então um segundo novelo, de cor diferente, em associação à questão: "Do mais importante que levo comigo, é...". Este procedimento repete-se para as questões seguintes, cada uma com um novelo de cor diferente: "Não estava à espera de..."e "No final deste percurso sinto-me....". \r\nNo final, forma-se uma teia colorida que une todos os participantes, sobressaindo a ideia da rede social, dos laços e entreajuda estabelecidos entre o grupo.
23	23	Participação semanal - Pensar positivo	São colocados dois desafios ao CI para esta semana:\r\n1.\tdeverá relembrar-se dos aspetos positivos associados ao cuidado;\r\n2.\tsempre que surjam situações menos boas, deverá fazer o exercício de procurar o lado positivo da situação.\r\nO CI deverá registar a experiência desta atividade no Diário de Bordo, descrevendo as situações e estratégias utilizadas.
21	21	"Importantómetro"	Inicialmente, é pedido aos elementos do grupo que reflitam por 3 ou 4 minutos sobre os aspetos positivos associados à tarefa de cuidar (i.e. O que há de mais positivo no cuidar do outro? \r\nQue tipo de satisfação está inerente ao cuidar do outro? O que justifica a continuidade do cuidado ao longo do tempo?).\r\nApós esta reflexão, é entregue a cada participante a ficha intitulada "Importantómetro", que dará apoio à concretização da restante atividade.\r\nÀ vez, é pedido ao CI que partilhe qual o aspeto mais positivo que encontrou no cuidar do seu familiar/amigo. \r\nTodos os elementos deverão escrever essa ideia na ficha (a ficha apresenta tantas opções, quanto o número de elementos do grupo). \r\nA certo ponto, os aspetos mais positivos dos elementos já foram referidos, pelo que o CI deverá identificar um novo aspeto positivo, e acrescentam na ficha de igual modo. \r\nNo final, é pedido que reflitam sobre os vários aspetos positivos associados ao cuidado e que os classifiquem numa escala de importância (0 - nada importante a 10 - extremamente importante).
24	24	O frasco (meio) cheio	Materiais: recipiente transparente (3 a 4 L); 1 Kg de arroz; café em pó (2 chávenas); Para cada CI participante: 1 bola de pingue-pongue, 2 botões coloridos (aprox. 2 cm diâmetro) e 4 grãos secos.\r\nCom esta atividade, pretende-se abordar a técnica de gestão do uso do tempo, de modo a incentivar o CI a realizar as atividades de lazer que lhe são mais prazerosas. \r\nDeve ser reforçada a ideia de que, para ganhar tempo, o cuidador necessita de gerir eficazmente as tarefas do dia-a-dia, fazendo esta gestão com base no grau de importância/ urgência de cada atividade, estabelecendo para isso, prioridades. \r\nO dinamizador terá consigo um recipiente transparente onde os CI irão colocar diversos objetos/ materiais. A cada CI é entregue 1 bola de pingue-pongue, 2 botões coloridos (aprox. 2 cm diâmetro) e 4 grãos secos. \r\nA cada tipo de objetos é atribuído um nível de satisfação para com as atividades de lazer (a bola representa a atividade de lazer preferida do CI, seguindo-se as 2 atividades representadas pelos botões e as últimas 4, que se materializam nos grãos secos). \r\n\r\nA atividade inicia com o pedido ao CI para que pense na atividade de lazer (física, de relação social, cultural, espiritual, ...) de que mais gosta. Em seguida, o CI coloca a bola dentro do recipiente, verbalizando e partilhando a atividade com os colegas. \r\nQuando todos tenham participado, passa-se para o nível seguinte.\r\nÉ agora pedido ao CI que identifique 2 atividades que também gosta bastante de realizar, mas menos do que a anterior. À vez, o CI deverá colocar os botões no recipiente, após partilhar com o grupo as atividades de que gosta. \r\nPor último, repete-se a atividade, agora para os 4 grãos secos, que representam outras atividades de lazer de que gosta, mas não tanto quanto as anteriores.\r\nPergunta-se ao grupo se estão satisfeitos com as atividades que identificaram e se o frasco estará suficientemente cheio. \r\nPartindo do pressuposto de que a resposta será negativa, o dinamizador deverá encher o recipiente com arroz, de modo a preencher os espaços vazios. \r\nÉ questionado ao grupo que tipo de atividades poderão ser estas, sendo que o dinamizador deverá orientar as respostas para aquelas atividades do dia-a-dia que têm necessariamente que existir, tais como preparar as refeições, tratar da nossa higiene, dormir... que também são atividades importantes para o bem-estar da pessoa".\r\nPor último, quando o recipiente parece estar cheio, pergunta-se novamente ao grupo se "não cabem mais atividades neste recipiente". \r\nO dinamizador deve então juntar duas chávenas de café ao recipiente (o que, metaforicamente, demonstra que a vida pode estar muito ocupada, mas que há sempre espaço para um café com um amigo!).
7	7	Imagens sentidas	Com esta atividade pretende-se que os CI partilhem com o grupo as dificuldades, constrangimentos, sentimentos e emoções sentidas na prestação de cuidados de higiene e conforto, eliminação, alimentação e medicação.\r\nO grupo deve ser disposto à volta de uma mesa. \r\nNo centro dessa mesa encontram revistas, jornais, tesouras, cola, folhas brancas, canetas/ lápis de cor. É proposto ao cuidador que crie uma imagem elucidativa (ex. recortes, desenho) de alguma das principais dificuldades, constrangimentos, sentimentos e emoções sentidas no âmbito da prestação destes cuidados.\r\nPosteriormente, cada CI partilha com o grupo a sua "obra" explicando-a à luz do objetivo da atividade.\r\nSempre que possível, devem enaltecer-se emoções positivas no contexto do cuidado e do papel do participante enquanto CI.\r\nNo final, os CI são convidados a deixar a sua "obra" no espaço da parede reservado para o efeito.
22	22	Estar bem para cuidar bem	Os elementos do grupo devem organizar-se em pares. \r\nÀ vez, cada um irá realizar uma massagem ao colega, de cerca de 8 minutos. \r\nEsta massagem pode ser realizada às mãos, utilizando um creme hidratante com cheiro agradável, ou utilizando um outro objeto que tenha esta função, por exemplo para massajar as costas/ braços ou a cabeça. \r\nComo tal, o dinamizador deverá criar um ambiente calmo, com música relaxante e, durante a massagem, convidar os elementos a fechar os olhos para potenciar a perceção táctil. \r\nA meio da atividade o dinamizador deverá perguntar se estão a gostar, pedindo que se foquem na sensação positiva vivenciada no momento; que tenham perceção das emoções presentes. Repete-se para os outros elementos.\r\nNo seguimento da atividade, deverá ser pedido ao grupo que verbalize as emoções identificadas no momento da massagem, promovendo-se deste modo, a consciencialização de emoções de satisfação e bem-estar. Neste contexto, deverá refletir-se sobre a importância do bem-estar na vida pessoal (na sua felicidade), assim como na qualidade dos cuidados prestados, uma vez que - se eu não estiver bem, não posso cuidar bem".
4	4	Árbitro de emoções	Participam mais ativamente nesta atividade os CI de RC com demência ou perturbação bipolar. \r\nNesta atividade os participantes são convidados a partilhar as suas emoções com o grupo acerca da gestão dos cuidados prestados e da doença do RC (por exemplo, partilha das principais dificuldades e angústias sentidas, assim como dos momentos de satisfação). Aquando desta partilha, o participante deverá levantar o cartão da cor associada ao tipo de emoções experienciadas, assumindo um papel de árbitro de emoções.\r\nDepois de explicar o objetivo da atividade, o dinamizador deverá distribuir um cartão verde, um amarelo e um vermelho por cada participante, explicando em seguida o significado de cada um:\r\n\r\n- o cartão verde deverá ser levantado pelo participante na partilha de emoções positivas e felizes;\r\n- o cartão vermelho na partilha de emoções negativas e de angústia. \r\n- o cartão amarelo deverá ser levantado quando o CI tem dúvidas se o que está a partilhar é positivo (verde) ou negativo (vermelho).\r\n\r\nSempre que um CI utiliza um cartão amarelo, os restantes elementos deverão ser convidados a ajudá-lo a decidir sobre o cartão verde ou vermelho para aquele mesmo assunto. Num contexto de empatia, são discutidas as nuances daquela situação, procurando-se que resulte num cartão verde (num olhar/ emoção positivo).
2	2	Regras de funcionamento do grupo	Preparação: Escrever as frases-chave em papéis separados para entregar a cada par de participantes. \r\nDistribuir uma folha de papel e canetas a cada conjunto de participantes.\r\nDesenvolvimento da atividade: \r\nDivide-se o grupo em pares e distribuem-se as frases-regra. Após alguma reflexão e análise acerca da frase-chave, cada par deverá escolher algumas palavras da frase para escrever numa folha. \r\nPosteriormente, cada par apresenta ao grupo a sua folha, havendo espaço para alguns comentários dos colegas.\r\n No final, deve questionar-se o grupo se existe(m) mais alguma(s) regra(s) a considerar. As folhas deverão ser afixadas no espaço onde decorre a sessão e lidas/ relembradas sempre que necessário. \r\n\r\nDe forma a promover uma convivência saudável e respeito mútuo entre o grupo, são aqui descritas algumas das regras de funcionamento. São elas:\r\n\r\n* Participação regular.\r\n* Respeito pelo horário definido.\r\n* Confidencialidade e sigilo. O que se diz no âmbito do grupo, deve ficar no grupo. Deve promover-se um ambiente de confiança entre todos.\r\n* Ouvir o outro, para ser ouvido. E, por isso, respeitar quando o outro fala. Existirá sempre espaço para se fazer ouvir.\r\n* Respeitar a opinião do outro e, como tal, a diferença em relação ao outro. \r\n* Não fazer juízos de valor. Não existem doentes nem cuidadores perfeitos.\r\n* As interações devem ocorrer no grupo e não entre pares.
13	13	A comunicação é um desafio no meu dia-a-dia	Com esta atividade, pretende-se explorar situações de dificuldade na comunicação ou na gestão de comportamentos indesejados/ desajustados no âmbito do dia-a-dia dos CI participantes. \r\nPara tal, deverão considerar-se os casos/ situações que cada CI trouxe para serem discutidos no grupo (segunda parte  da Atividade 12).\r\nDeverá ser utilizada a mesma metodologia da sessão anterior (Atividade 10), sendo que neste caso quem expõe a situação é um dos CI. \r\nO grupo é convidado a discutir, de modo a identificar as boas práticas na comunicação utilizadas, os potenciais erros ou debilidades e apontar outras opções que permitam lidar com a situação. O dinamizador deverá validar/ corrigir as participações dos CI, acrescentando informação sempre que necessário. Para tal, terá também a orientação do panfleto "Boas práticas na comunicação e na gestão de comportamentos". \r\nDeverá repetir-se para os restantes casos.\r\nApós a exploração de cada caso, os CI deverão sistematizar as boas práticas na comunicação e na gestão de comportamentos inapropriados, acrescentando informação nas cartolinas/ folhas já utilizadas na sessão anterior, num trabalho realizado em grupo (mantendo os mesmos grupos da Atividade 10). \r\nAs cartolinas/ folhas deverão ficar afixadas no espaço onde decorre a sessão e lidas/ relembradas sempre que necessário.
11	11	Momento de reflexão	Com esta atividade pretende-se que o CI tenha a oportunidade de refletir sobre os conteúdos anteriormente abordados, focando-se nas diferentes formas de lidar com os desafios, refletindo sobre a sua capacidade, potencialidade e competência, enaltecendo a valorização do seu papel. \r\nO dinamizador deverá criar um ambiente calmo, de meia-luz, com música calma. Após preparação do ambiente, deverá ajudar os CI a respirarem mais pausadamente, a fecharem os olhos, e deverá dizer-lhes (de forma calma e pausada): \r\n"Este momento foi criado para que possam refletir sobre os assuntos que estivemos hoje a explorar: as diferentes situações e formas de lidar com elas; assim como as experiências vividas no dia-a-dia com o RC. Não esqueçam ainda de recordar os momentos positivos e de satisfação.\r\nEste é um momento vosso."\r\nNo final do tempo previsto para a atividade, o dinamizador deverá pedir aos CI que abram os olhos, retomar a luminosidade anterior e perguntar se se sentem bem. Só depois deverá desligar o som.
\.
