6	Memória Visual Diferida	6	15	A partir do exercício de memória visual imediata (exercício 4) os participantes devem responder a perguntas sobre as imagens	* Quadro/ cartão\r\n* Dossier de exercícios	Agora vamos recordar as imagens que memorizaram há pouco. \r\n\r\nCada participante, um de cada vez, dirá um elemento que se recorda de cada imagem (cada participante diz um elemento da imagem 1, da imagem 2 e assim sucessivamente).\r\nSe não acertar será aplicada uma prova de reconhecimento através da visualização da imagem integrada num conjunto de 2 imagens distratoras).  \r\n\r\nO facilitador regista na tabela o desempenho de cada participante (Teve/não teve dificuldade; Com/sem ajuda)	
9	Memória lógica Verbal Imediata e Leitura	7	15	A. Lista de palavras (2 palavras)\r\n\r\nB. Lista de palavras (3 palavras)	* Quadro\r\n* Dossier\r\n* Lápis	Vou dizer calmamente um conjunto de palavras que vou pedir-vos que as memorizem. Seguidamente escrevem no vosso caderno. \r\nQuem quer repetir as palavras que disse?\r\n\r\n**Notas: No caso dos participante sem literacia ou com dificuldades na escrita, o facilitador escreve no caderno desse mesmo participante.\r\nApenas um dos participantes (participação voluntária) repete as palavras em voz alta. Os colegas podem ajudar.\r\nAplicar pelo menos 2 séries de cada nível. Começar pelo nível mais simples e depois o nível mais complexo. Todos os participantes podem fazer as várias séries. **	
2	Orientação temporal e espacial	1	10	Assinalar no calendário a data, hora e localização da sessão.	* Calendário que está no inicio de cada dossier\r\n* Lápis\r\n* Dossier de exercícios	Na primeira página do vosso dossier encontram um calendário onde vamos assinalar a data de hoje. Se souberem que dia é hoje, por favor façam um círculo à volta desse dia Abram o dossier no separador da sessão de hoje.\r\n \r\n**Nota: O facilitador deve mostrar qual o espaço reservado para cada uma das instruções (data, hora, local).**	Na primeira página do vosso dossier encontram um calendário onde vamos assinalar a data de hoje. Se souberem que dia é hoje, por favor façam um círculo à volta desse dia Abram o dossier no separador da sessão de hoje.
7	Encerramento	99	10	Os participantes classificam a sessão utilizando os quatro smiles presentes em cada dossier. Acrescentam comentários, se o desejarem.\r\n\r\nRelembrar a data da próxima sessão e Despedida dos participantes	* Imagens dos smiles (projetadas ou em cartão)\r\n* Dossier de exercícios\r\n* Lápis	Observe as imagens e escolha a que melhor representa a maneira como se sentiu. Assinale no seu dossier.\r\n\r\nSe quiser, pode escrever, no espaço reservado para o efeito, comentários.	
