20	Atenção e Memória operativa	18	15	Apresentação da numeração de 0-10\r\n\r\n\r\nA. Apresentação de Séries numéricas ordem direta\r\n\r\nB.  Apresentação de Séries numéricas ordem Inversa	* Quadro\r\n* Dossier de exercícios\r\n* Lápis	Vou pedir que me indiquem alternadamente, os seguintes números: 0- 10. Quem quer começar?	
21	Memória verbal diferida	19	20	Os participantes devem contar a notícia do jornal\r\n\r\n\r\nA. Evocação Guiada com pistas\r\n\r\nB. Evocação Livre	* Dossier de exercícios\r\n* Lápis	Gostava que se recordem da notícia do jornal que falámos anteriormente.	
