17	Memória verbal remota	15	30	Contar de algum acontecimento importante na vida do sujeito (data, pessoas envolvidas e ação).	* Quadro\r\n* Dossier de exercícios\r\n* Lápis	Gostava que me contassem um acontecimento de vida pessoal recente (por exemplo, o que fizeram no fim-de-semana) referindo: onde, quando, como, o quê e quem. \r\n\r\nA. Os participantes devem descrever oralmente o seu acontecimento. \r\n\r\nB. Os participantes devem registar no caderno e ler para os restantes participantes.	
18	Reconhecimento visual	16	15	Reconhecimento dos objetos quotidianos\r\n\r\nA. Reconhecimento com pistas;\r\n\r\nB. Reconhecimento sem pistas	* Quadro\r\n* Dossier de exercícios\r\n* Lápis	Gostava que me contassem um acontecimento de vida pessoal recente (por exemplo, o que fizeram no fim-de-semana) referindo: onde, quando, como, o quê e quem. \r\n\r\nA. Os participantes devem descrever oralmente o seu acontecimento. \r\n\r\nB. Os participantes devem registar no caderno e ler para os restantes participantes.	
