28	Praxia ΓÇô Uso de objetos / Compreensão de instruções simples	26	20	Os participantes devem realizar um conjunto de ações.	* Quadro\r\n* Dossier de exercícios\r\n* Caixa de fósforo\r\n* Pente\r\n* Copo\r\n* Pincel\r\n* Óculos (usar de preferência do participante)\r\n* Tesoura	Peço que observem estes objetos que estão colocados em cima da mesa. \r\n(O facilitador pega em cada objeto - pela ordem descrita em cima)\r\nO que é este objecto?\r\nPara que serve?\r\nVamos fazer o gesto como se? (ver as ações a baixo)\r\n(O facilitador lê as instruções com as ações a realizar com cada objecto)	
