1	Orientação Pessoal	0	30	Os participantes jogam uma bola uns aos outros dizendo o seu nome e completando a frase que está mais próximo do polegar direito.	* Bola	Vamos fazer um jogo com esta bola. Esta bola tem o inicio de frases escritas e cada um de nós terá que completar. \r\nEu vou atirar a bola a um de vocês. Agarram a bola, dizem o vosso nome e idade e completam a frase que estiver mais próximo do polegar direito (indicar qual é o dedo polegar direito). \r\nEm seguida atiram a bola a outro colega e este faz o mesmo. \r\n\r\nEu começo:  "O meu nome é ... tenho ... anos e (ler a frase da bola em voz alta e completá-la)"\r\n\r\n**Nota: Se o participante quiser escolher outra frase pode fazê-lo. No caso do participante não conseguir ler, o facilitador oferece-se para o fazer.**	
3	Memória de aprendizagem / associação cara-lugar dos participantes do grupo	2	20	Os participantes fazem corresponder a fotografia de cada participante ao lugar que estão sentados.	* Quadro interativo / Cartolina\r\n* Bostike\r\n* Lápis\r\n* Dossier de exercícios\r\n* Fotografia dos participantes	Vamos descobrir quem é que está sentado onde.\r\n\r\nO facilitador coloca/projeta a imagem da mesa da sala no quadro/parede.  Dá a cada participante a sua própria fotografia.\r\n\r\nUm de cada vez levanta-se e desloca-se até à imagem, identifica o seu lugar e cola a sua fotografia. Eu exemplifico. \r\n\r\nO facilitador coloca a sua fotografia no seu lugar.\r\nDepois dos participantes colocarem as suas fotografias, o facilitador revê com o grupo quem é que está sentado onde.\r\n\r\nQuem quiser pode escrever  no dossier na imagem.\r\n\r\n\r\n**Nota: Se o facilitador perceber que o participante está com dificuldades, orientá-lo e dar pistas para a obtenção da resposta certa. (ex. "Se facilitar, pode olhar para a mesa.")**	
