COPY public.mentha_noticia (id, titulo, texto, data, url, imagem) FROM stdin;
5	Protótipos interativos prontos	Foram desenvolvidos 3 protótipos interativos das aplicações a produzir. Serão usados para validar as interações e funcionalidades pensadas.\r\nSerão usados numa sessão de validação de usabilidade destes por profissionais das áreas vindos dos diferentes parceiros do projeto.\r\nCom base no feedback recolhido, serão validadas funcionalidades e feitas adaptações ou integradas novas funcionalidades para que as aplicações vão ao encontro das necessidades do público alvo.	2022-04-22	\N	mentha/noticias/prototipo_care.jpg
9	Desenho de casos de uso das aplicações e modelação conclusões	Foi encerrado o desenho de casos de uso e diagramas das vᲩas atividades que estas contemplam, permitindo uma especificação detalhada do que serᠩmplementado. \r\n\r\nA modelação dos dados, com identificação das entidades necessᲩas e suas relações foi feita, permitindo a sua implementação em bases de dados adequadas.	2022-04-07	\N	mentha/noticias/diagrama_atividades.png
10	Defesa de projetos	Foram defendidos dois trabalhos finais de curso, das licenciaturas em Engenharia Informática e Informática de Gestão da Universidade Lusófona, no âmbito do MentHA Digital:\r\n\r\n* Inês Rocha e João Pedro Santos, MentHA CARE \r\n* Nuno Rasteiro, Protocolo MentHA\r\n\r\nOs projetos foram muito apreciados pelo júri, tendo sido <b>classificados entre os 5 melhores trabalhos do ano</b>. Estão todos de parabéns. Os relatórios encontram-se disponíveis no link em baixo.	2022-09-21	https://informatica.ulusofona.pt/defesas/trabalhos-finais-de-curso/	
3	Levantamento e análise de requisitos	Foi realizado um levantamento detalhado de requisitos funcionais e não-funcionais pela equipa de desenvolvimento, com o apoio de especialistas das áreas tecnológicas e sociais. \r\n\r\nDesta forma as aplicações a desenvolver integrarão funcionalidades que vão ao encontro das necessidades do público alvo explorando as tecnologias mais avançadas na área.\r\n\r\nEm termos técnicos, estes requisitos permitirão desenhar casos de usos e diagramas de atividades, assim como pensar na modelação da base de dados que dará suporte às aplicações.	2022-03-24	\N	mentha/noticias/requisitos.png
2	Reunião de apresentação aos Parceiros	Foi realizada uma reunião de apresentação do MentHA Digital com todos os parceiros do projeto. \r\n\r\nForam apresentados os objetivos e soluções a desenvolver. O projeto irá arrancar em março, tendo já sido delineado um cronograma de terafas a realizar que envolvem os vários parceiros nas diferentes fases do projeto.	2022-02-22	\N	
11	5 novos colaboradores do MentHA Digital	O MentHA Digital conta com 5 novos colaboradores: Alexandre Godinho, Bernardo Roque, Rodrigo Eira, Tiago James e Tiago Silva. Desenvolverão <b>3 novos trabalhos finais de curso</b> em torno do Protocolo MentHA, MentHA CARE e MentHA COG. O objetivo será validar com os parceiros os protótipos já desenvolvidos, identificar requisitos de melhoria e implementá-las. \r\n\r\nO Nuno Rasteiro, que fez trabalho final de curso em torno do Protocolo MentHA e se licenciou em set'22, continua a trabalhar como investigador no projeto MentHA. Está a integrar as várias aplicações desenvolvidas.	2022-11-06	\N	
8	Estão prontos os guiões para experimentar protótipos	Foram criados 3 guiões para o público alvo poder experimentar os 3 protótipos interativos que já foram criados.\r\n\r\nSerá realizada uma sessão com colaboradores dos vários parceiros do Projeto MentHA, para experimentar os protótipos e darem o seu feedback. \r\n\r\nCom base num guião de tarefas, experimentarão todas as funcionalidades dos protótipos, permitindo-lhes aferir as funcionalidades propostas, e permitindo-nos recolher o seu valioso feedback, por forma a construirmos com os parceiros estas aplicações. Pretende-se aprimorar a acessibilidade e usabilidade destas aplicações.	2022-05-05	\N	mentha/noticias/Guiao_tarefas.png
1	MentHA Digital ganhou concurso DGS	O Projeto Mentha Digital da Universidade Lusófona ficou em 1º lugar num concurso da Direção Geral da Saúde (DGS) a financiamento público, no âmbito do Programa Nacional para a Saúde Mental. \r\n\r\nUma equipa de investigadores e alunos de Engenharia Informática e Informática de Gestão do DEISI-COPELABS fará o desenvolvimento de um conjunto de aplicações para treino cognitivo de adultos mais velhos com demência assim como um programa psico-educativo para seus cuidadores.	2022-01-06	\N	mentha/noticias/Screenshot_2024-07-15_at_18.24.29.png
7	Desenvolvimento das aplicações em bom andamento	A equipa de desenvolvimento encontra-se a trabalhar arduamente no desenvolvimento dos prototipos funcionais. \r\n\r\nEstão a ser integradas nas aplicações várias funcionalidades que ajudarão a melhorar o bem-estar e a qualidade de vida de adultos mais velhos com patologia mental crónica e dos seus cuidadores formais e informais.	2022-05-11	\N	mentha/noticias/mentha-devops.jpg
4	Questionário de viabilidade e pertinência	Foi elaborado um inquérito de avaliação de pertinência sobre as intervenções à distância na área do envelhecimento e da saúde mental.\r\n\r\nEste inquérito pretende conhecer a opinião da população em geral, incluindo as principais partes interessadas (pessoas com experiências de saúde mental, cuidadores informais e formais) e, com base nos resultados, promover iniciativas que facilitem o acesso remoto a intervenções no âmbito da saúde mental dos adultos mais velhos.	2022-04-21	https://docs.google.com/forms/d/1MM2N4n7lNTwsJQkwHeX6BOp48S3aLe3KLhRh02qFzM4/edit?urp=gmail_link	mentha/noticias/questionario_pertinencia.png
17	MentHA Digital na ADEB	A equipa do projeto MentHA esteve no dia 18 de julho na ADEB - Associação de Apoio aos Doentes Depressivos e Bipolares. Reunimos com a equipa de técnicos da ADEB assim como utentes e cuidadores. Foram apresentadas e demonstradas as aplicações MentHA CARE, MentHA COG e MentHA Eval. Em espírito de co-construção, recebemos valiosos feedbacks que estamos a integrar de forma a que sejam aplicações que satisfaçam as necessidades dos seus utentes finais.	2023-07-18	\N	mentha/noticias/ADEB.png
14	Apresentação de trabalhos finais de curso desenvolvidos no âmbito do MentHA Digital	Foram apresentados dois trabalhos finais de curso, das licenciaturas em Engenharia Informática e Informática de Gestão da Universidade Lusófona, desenvolvidos no âmbito do MentHA Digital:\r\n\r\n* Tiago Silva e Rodrigo Eira, MentHA CARE \r\n* Bernardo Roque e Alexandre Godinho, Protocolo MentHA e MentHA Risk\r\n\r\nOs projetos foram muito apreciados pelo júri, tendo obtido excelentes classificações, fruto do bom trabalho realizado ao longo deste ano. Estão todos de parabéns.	2023-07-03	\N	mentha/noticias/defesa_de_TFCs_2023.07.jpeg
13	Projeto MentHA Digital Premiado com Bolsa de Investigação Akira 2022 da SPA	O projeto MentHA RISK foi premiado com a "Bolsa de Investigação Akira 2022", promovida pela Sociedade Portuguesa de Aterosclerose (SPA) e com o apoio da Daiichi Sankyo. Este projeto, integrado no MentHA Digital, visa a avaliação do risco cardiovascular em adultos mais velhos com patologia mental crónia. O prémio foi entregue numa cerimónia na Sociedade Portuguesa de Aterosclerose, com a presença do Jornal NewsPharma.	2022-09-12	https://spaterosclerose.org/noticias/item/435-bolsa-de-investigacao-akira-2022-ferramenta-de-promocao-a-investigacao-cientifica.html	mentha/noticias/mentha_risk.jpg
19	MentHA Digital no XII Seminário de Gerontologia	A equipa do MentHA Digital esteve no XII Seminário de Gerontologia da Universidade Lusófona a partilhar a sua experiência e desafios que tem encontrado. Foi um valioso momento de reflexão sobre estratégias para prevenir e retardar perdas cognitivas e melhorar o bem-estar de adultos mais velhos com demêcia e dos seus cuidadores.	2023-06-16	https://fb.watch/lV-ev7KqpH/?mibextid=2Rb1fB	mentha/noticias/seminario.png
18	GIRA recebe equipa do MentHA Digital	A equipa do projeto MentHA esteve no dia 19 de julho numa residência da GIRA - Grupo de Intervenção e Reabilitação Ativa. Reunimos com a equipa de técnicos da GIRA assim como utentes e cuidadores. Foram apresentadas e demonstradas as aplicações MentHA CARE, MentHA COG e MentHA Eval. Em espírito de co-construção, recebemos valiosos feedbacks que estamos a integrar de forma a que sejam aplicações que satisfaçam as necessidades dos seus utentes finais.	2023-07-19	\N	mentha/noticias/GIRA.png
16	Roche Sistemas de Diagnósticos estabelece protocolo e patrocínio com MentHA Digital	Em 2022 ganhámos um prémio da Associação de Aterosclerose para, de forma inovadora, estudar o risco cardiovascular de adultos mais velhos com doença ou deficiência mental e perturbação neurocognitiva. \r\n\r\nPara a realização deste estudo estabelecemos um protocolo com a Roche Sistemas de Diagnósticos, tendo recebido um patrocínio de equipamento de medida (“point of care") que nos foi emprestado durante 6 meses para fazermos as medidas, assim como  dispositivos/reagentes para o cálculo deste risco. \r\n\r\nPara além dos aparelhos serão disponibilizados os reagentes necessários e a formação dos profissionais que farão a recolha nos locais onde se encontram os participantes.	2023-02-06	\N	mentha/noticias/Point_of_care_da_Roche.jpeg
20	DGS estende apoio ao MentHA Digital por mais 6 meses	A DGS aprovou a extensão do seu apoio ao projeto MentHA Digital por mais seis meses, até julho. Permitirá terminar uma parte das investigações em curso e desenvolvimentos.\r\n\r\nestamos a trabalhar ativamente com os nossos parceiros no desenvolvimento de programas e ferramentas que sejam úteis para melhorar o bem-estar de adultos mais velhos com demência e dos seus cuidadores. O projeto entretanto tem tido apoio de outras instituições, e estabelecimento de novos protocolos para garantir a sua continuidade.	2023-02-28	\N	mentha/noticias/DGS.png
12	Sessão de validação dos Protótipos MentHA	Os parceiros do projeto MentHA Digital - Mental Health and Ageing participaram numa sessão de experimentação e validação dos Protótipos MentHA que contou com <b>19 participantes</b>.\r\n\r\n\r\nNeste encontro foram apresentados os três protótipos interativos desenvolvidos das aplicações web:\r\n\r\n1. Programa de treino cognitivo - MentHA COG\r\n2. Avaliação neuropsicológica - Protocolo MentHA\r\n3. Programa psicoeducativo para cuidadores - MentHA CARE\r\n\r\nCada participante teve depois oportunidade de interagir com cada um dos protótipos aplicacionais, auxiliado por um guião de tarefas que permitiu explorar todas as funcionalidades desenvolvidas. No guião cada participante registou o sucesso de cada passo assim como deu sugestões de melhoria. \r\n\r\nA sessão correu muito bem, tendo havido feedbacks muito positivos. Temos todos os parceiros implicados na co-criação e implementação das diferentes aplicações, devidamente validadas para os diferentes contextos. Este trabalho beneficiará da partilha de experiências e dos conhecimento das diferentes partes interessadas, reforçando este desafio, indiscutivelmente  estimulante e gratificante suas diferentes variantes: humana, académica, clínica e tecnológica.	2022-06-02	\N	mentha/noticias/285634740_10216205906818889_4374820038972196398_n.jpg
24	Parceria com a Escola Superior de Saúde da Cruz Vermelha Portuguesa	Foi estabelecida uma parceria entre o Projeto MentHA e a Escola Superior de Saúde (ESS) da Cruz Vermelha Portuguesa, no apoio à avaliação do risco cardiovascular em pessoas com mais de 40 anos e com doença mental associada.  Em abril, a Área de Ensino de Enfermagem da ESS CVP Lisboa irá apoiar o Projeto MentHA na instituição CRINABEL, em Lisboa, com as Professoras Graça Moraes Rocha, Inês Bento e Maria Pires, juntamente com as estudantes do 4º ano do curso de enfermagem Joana Arsénio e Maria Santos.	2024-03-10	https://www.esscvp.eu/ess-cvp-lisboa-estabelece-parceria-com-o-projeto-mentha/	mentha/noticias/ESS_CVP.jpg
15	ASMAL no Algarve recebe equipa do MentHA Digital	Entre os dias 12 e 14 de julho estivemos no Algarve na semana passada três dias, na ASMAL - Associação de Saúde Mental do Algarve, os coordenadores Pedro Santos e Lúcio Studer assim como quatro investigadores do COPELABS, Bernardo Roque, Nuno Rasteiro, Rodrigo Eira e Tiago Silva, tendo testado a aplicação em três centros da ASMAL (Faro, Almancil e Loulé) e interagido e recolhido dados de 54 utentes. Correu muitíssimo bem!\r\n\r\nEsta deslocação ao “terreno”, no Algarve, contou já com a aplicação de um dos programas, o MentHA Risk - avaliação do risco de AVC em adultos mais velhos com doença mental. Tivemos no primeiro dia a colaboração de um técnico da Roche que  trabalhar com a equipa alargada e dar formação a uma equipa da Cruz Vermelha Portuguesa (entidade parceira do MentHA Digital), para utilização dos equipamentos e materiais disponibilizados. A equipa do projeto MentHA deu formação aos diferentes profissionais dos centros da ASMAL, que também acompanharam a avaliação de risco cardiovascular dos seus utentes. Foram apresentadas as aplicações desenvolvidas, MentHA Eval, MentHA-COG e MentHA-CARE. Estas foram experimentadas pelos técnicos assim como por cuidadores e participantes. \r\n\r\nFoi uma experiência muito gratificante e inesquecível, para todos os participantes. Os técnicos da ASMAL ficaram muito bem impressionados e entusiasmados com a grande utilidade e apoio que a aplicações desenvolvidas podem dar ao seu trabalho diário.	2023-07-14	\N	mentha/noticias/asmal.jpeg
21	Avaliação Gratuita de Risco Cardiovascular na ADEB	O Projeto MentHA - Mental Health and Aging e a ADEB - Associação de Apoio aos Doentes Depressivos e Bipolares promovem no próximo sábado, 14 de outubro, uma Sessão de Prevenção e Avaliação de Risco Cardiovascular em pessoas com mais de 40 anos e doença neuropsiquiátrica: perturbação bipolar, esquizofrenia, deficiência intelectual, demência.\r\n\r\nNo final da semana em que se comemora mais um Dia Mundial para a Saúde Mental, este ano com o tema "Nossas Mentes, Nossos Direitos” (Our minds, our rights) o Médico Internista Francisco Araújo - Coordenador do Departamento de Medicina Interna do Hospital dos Lusíadas de Lisboa - dinamizará uma sessão de sensibilização sobre o Risco Cardiovascular no contexto da saúde mental.\r\n\r\nA avaliação de risco cardiovascular será disponibilizada de forma individualizada e gratuita, com apoio de uma equipa da Escola Superior de Saúde da Cruz Vermelha Portuguesa e da Roche Sistemas de Diagnóstico, no âmbito do programa MentHA Risk, financiado pela Direcção Geral da Saúde e pela Sociedade Portuguesa de Aterosclerose. \r\n\r\nAs doenças cardiovasculares (DCV) são responsáveis pela morte de cerca de 25% das pessoas com esquizofrenia e de 33% das pessoas com doença bipolar (Nielsen et al. 2020). Alguns estudos recentes sugerem os portugueses são mais afetados por demência vascular do que por Alzheimer (Ruano et al., 2019) e que os indivíduos com deficiência intelectual apresentam riscos acrescidos de DCV de início precoce, em particular, de doença cerebrovascular, acidente vascular cerebral, insuficiência cardíaca e trombose venosa profunda (Wang et al., 2023).	2023-10-14	https://www.adeb.pt	mentha/noticias/participe-mentha-risk-avaliacao-de-risco-cardiovascular.jpeg
22	MentHA Digital com a CRINABEL	Dia 16 de abril de 2024 o MentHA e a Crinabel reuniram-se pela primeira vez. A sessão foi um sucesso e pretende-se fortalecer esta parceria.	2024-04-16	https://www.crinabel.pt/a-nossa-historia	
25	MentHA Digital vai ao Algarve fazer sessões de avaliação na ASMAL	O Projeto MentHA Digital foi três dias ao Algarve fazer uma segunda sessão para aplicação das várias aplicações. Com apoio da CVP, delegação do Algave, foi feita a avaliação de 45 pessoas, avaliação neuro-psicológica assim como do risco de acidente cardiovascular.	2024-02-14	https://asmal.org.pt/asmal/	mentha/noticias/asmal.png
23	Reportagem sobre o Projeto MentHA	O MentHA teve uma reportagem feita pela equipa de ocmunicação da Universidade Lusófona, entre 16 e 19 de abril, nas sessões de aplicação das ferramentas do MentHA Digital na CRINABEL, uma cooperativa com estatuto de utilidade pública sem fins lucrativos criada para apoio à reabilitação de jovens e adultos com atraso no desenvolvimento.	2024-05-27	https://www.youtube.com/watch?v=xOG0dOYjQLA	mentha/noticias/Captura_de_ecrã_2024-06-26_130248.png
26	Submetido relatório à Direção Geral da Saúde	Foi submetido à Direção Geral de Saúde o relatório final da componente do Projeto MentHA que foi financiada pela DGS. \r\n\r\nFoi co-desenvolvido um estudo de viabilidade e pertinência de Plataforma Digital Para Adultos Mais Velhos com Problemas de Saúde Mental através da elaboração e implementação de "Questionário de Avaliação de Pertinência" e participação de representantes das diferentes partes interessadas (pessoas com doença ou deficiência mental, cuidadores formais e informais, representantes de parceiros e membros da sociedade civil).\r\n\r\nFoi co-criada a Plataforma "MentHA DIGITAL" (com participação e envolvimento de todos os parceiros) para promoção da (i) Cidadania em Saúde, (ii) Equidade e Acesso, (iii) Políticas Saudáveis e (iv) Bem-estar e da qualidade de vida de adultos com patologia mental crónica, em diferentes contextos de vida.\r\n\r\nForam co-criadas as aplicações MentHA COG, MentHA CARE, MentHA RISK e Protocolo de Avaliação MentHA.\r\n\r\nForam realizadas diferentes sessões de experimentação e validação das aplicações (presenciais e remotas) com representantes das entidades parceiras\r\n\r\nForam incluidos novos parceiros, e de valências complementares, para reforço dos objetivos do projeto e melhoria dos cuidados de saúde mental (bio-psico-socias) centrados na pessoa, reforçando, nomeadamente, a componente biomédica do projeto: avaliação de risco cardiovascular e risco de diabetes;\r\n\r\nUm dos pontos fortes foi o potencial de sustentabilidade e reconhecimento social, com o Prémio de "Bolsa de Investigação Akira 2022”, promovida pela Sociedade Portuguesa de Aterosclerose - SPA e da Daiichi Sankyo, assim como apoio da Roche Sistemas de Diagnósticos.	2024-07-15	\N	mentha/noticias/dgs.png
27	Trabalho Final de Curso no âmbito do Projeto MentHA Digital	Foi apresentado com sucesso a conclusão do Trabalho Final de Curso de Miguel Cardoso e António Ventura desenvolvido no âmbito do Projeto MentHA Digital. Decorreu entre setembro 2023 e julho 2024. O objetivo foi melhorar alguams ocmponentes das aplicações MentHA Eval, RISK, CARE, COG. Focou-se no levantamento de requisitos com as várias entidades parceiras. À medida que os parceiros utilizam a aplicação, recebem feedback e posteriormente procedem à melhoria das aplicações. As muitas sessões com instituições parceiras do projeto realizadas foram importantes para a melhoria das aplicações, sendo dada a devida prioridade aos requisitos consoante os pedidos feitos pelas mesmas.	2024-07-09	https://informatica.ulusofona.pt/tfcs-dissertacoes-teses/	mentha/noticias/mentha_e_ess.jpg
